import './App.css';

const Home = () => {
    return <h1>Home</h1>;
};
const Blog = () => {};

function App() {
    return (
        <Router>
            <div>
                <Header />
                <main>
                    <Switch>
                        <Route exact path="/">
                            <Home />
                        </Route>
                        <Route path="/other">
                            <OtherPage />
                        </Route>
                    </Switch>
                </main>
            </div>
        </Router>
    );
}

export default Header;
